import React from "react";

const Activitypoints = ({ points }) => {
  return (
    <>
      <ul>
        {points.map((values) => (
          <li>
            {values.missingPoints} : {values.reportmissingItems}
          </li>
        ))}

        <li>{points.reportmissingItems}</li>
        <li>{points.filterDate}</li>
      </ul>
    </>
  );
};

export default Activitypoints;
